## Create a Tooltip in NextJS using React Context

### Step 1: Create a Tooltip Context

Create a TooltipContext.js file in the components folder and add the following code.
```
import React, { createContext, useState } from "react";

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```
### Step 2: Create a Tooltip Component

Create a Tooltip.js file in the components folder and add the following code.
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

const Tooltip = ({ children, tooltip }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div className="tooltip">
      <div className="tooltip__content">{tooltip}</div>
      <div className="tooltip__trigger" onClick={() => setTooltip(null)}>
        {children}
      </div>
    </div>
  );
};

export default Tooltip;
```
### Step 3: Create a Tooltip Trigger Component

Create a TooltipTrigger.js file in the components folder and add the following code.
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

const TooltipTrigger = ({ children, tooltip }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div className="tooltip__trigger" onClick={() => setTooltip(tooltip)}>
      {children}
    </div>
  );
};

export default TooltipTrigger;
```
### Step 4: Create a Tooltip Wrapper Component

Create a TooltipWrapper.js file in the components folder and add the following code.
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

const TooltipWrapper = ({ children }) => {
  const { tooltip } = useContext(TooltipContext);

  return <div className="tooltip__wrapper">{tooltip && <Tooltip tooltip={tooltip} />}{children}</div>;
};

export default TooltipWrapper;
```
### Step 5: Use the Tooltip Component

Now we can use the Tooltip component in our application. For example, we can create a Tooltip component that displays a tooltip when the user hovers over a button.
```
import React from "react";
import { TooltipProvider } from "./components/TooltipContext";
import { TooltipWrapper } from "./components/TooltipWrapper";
import { TooltipTrigger } from "./components/TooltipTrigger";

const App = () => {
  return (
    <TooltipProvider>
      <TooltipWrapper>
        <TooltipTrigger tooltip="This is a tooltip">Hover over me</TooltipTrigger>
      </TooltipWrapper>
    </TooltipProvider>
  );
};

export default App;
```
