## 1. Inline Styles

Inline styles are the most basic way to style a react app. You can use the style prop to add inline styles to any element. For example:
```
const App = () => {
  return (
    <div style={{ backgroundColor: "red", color: "white" }}>
      Hello World!
    </div>
  );
};
```
In this example, we are using the style prop to add inline styles to a div element. The style prop takes an object with CSS properties as keys and their values as values. In this case, we are setting the background color to red and the text color to white.

